  const {photos, setPhotos} = useState([])
  useEffect(()=>{
    const fetchAllPhotos = async () =>{
      try {
        const res = await axios.get("http://localhost:8800/photos")
        console.log(res)
        setPhotos(res.data)
      } catch (error) {
        console.log(error)       
      }
    }
    fetchAllPhotos()
  })

